css:
@-moz-document
	url-prefix('http://www.tumblr.com/'),
	url-prefix('https://www.tumblr.com/')
{

.new_post_label/*_icon*/ > I {display: none !important}

.new_post_label {
  font-size: 24px !important;
  padding: 6px 1px 73px 0 !important;
  font-family: Helvetica, Trebuchet MS, sans-serif !important;
  text-transform: lowercase !important;
  font-style: italic!important;
  color: #ffffff !important;
  letter-spacing: -3px !important;
}

.new_post_buttons {
  background: #fff center no-repeat url('data:image/jpeg;base64,') !important;
  background-size: cover !important;
}

}
